import React from 'react';
import { ListGroup } from 'react-bootstrap';

export default function workers_management() {
  return (
  <ListGroup as="ul">
    <ListGroup.Item as="li" button onClick={this.handleClick} >List of workers</ListGroup.Item>
    <ListGroup.Item as="li">Add New Worker</ListGroup.Item>
  </ListGroup>


  );
}
